from bs4 import BeautifulSoup

class SmallPoke():
    def __init__(self,select_attr):
        self.select_attr=select_attr
        self.soup=BeautifulSoup(smallpokemonhtml,'html.parser')
        self.all_pokemondatas=self.get_pokemon_data()
        self.show_list=self.get_show_list()

    def get_pokemon_data(self):
        return self.soup.find_all('div', class_='infocard')

    def get_show_list(self):
        data=[]
        for i in self.all_pokemondatas:
            '''attr'''
            attr = list(map(lambda x: x.text.strip(), i.select('a[class^="itype"]')))
            if not self.select_attr == 'None':
                if not self.select_attr in attr:
                    continue
            '''name'''
            name = i.find('a', class_='ent-name').text
            '''image'''
            image = i.find(lambda tag: 'data-src' in tag.attrs).get('data-src')
            '''id'''
            id = i.find(lambda tag: tag.text.strip()[1:].isdigit()).text
            data.append([id, name, attr, image])
        return data


